export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y,z,A,B,C,D,E,F,G,H,I,J,K,L,M,N,O,P,Q){return {data:{"/portfolio/online-multiplayer-shooter":{project:{_path:"\u002Fportfolio\u002Fonline-multiplayer-shooter",_dir:i,_draft:f,_partial:f,_locale:j,_empty:f,title:r,description:"This project was created for the full-stack module at University. I had to create a full-stack application and demonstrate the ability to handle real-time data using WebSockets.",keywords:"Vuejs, Game, MongoDB, Node.js, WebSockets",image:"\u002Fimages\u002Fproject-online-shooter-thumbnail.webp",banner:"\u002Fimages\u002Fproject-online-shooter-banner.webp",type:s,date:"3",tags:[t,"Websockets",u,v,w],body:{type:k,children:[{type:a,tag:l,props:{id:"online-multiplayer-shooter"},children:[{type:b,value:r}]},{type:a,tag:c,props:{},children:[{type:b,value:"This project was created for the full-stack module at Plymouth University and received\na strong first."}]},{type:a,tag:c,props:{},children:[{type:a,tag:g,props:{href:"https:\u002F\u002Fgithub.com\u002Fmattfletcher94\u002Fmultiplayer-shooter",target:h},children:[{type:b,value:"See GitHub Repo"}]}]},{type:a,tag:c,props:{},children:[{type:a,tag:g,props:{href:"https:\u002F\u002Fyoutu.be\u002FhVRlS9BiE78?t=83",target:h},children:[{type:b,value:"See Demo Here"}]}]},{type:a,tag:e,props:{id:x},children:[{type:b,value:y}]},{type:a,tag:c,props:{},children:[{type:b,value:"For this module, we had to create a full-stack application and demonstrate\nour ability to handle real-time data using WebSockets. We were also\nencouraged to write both unit and end-to-end tests. My idea\nwas to create an online multiplayer shooter."}]},{type:a,tag:e,props:{id:z},children:[{type:b,value:A}]},{type:a,tag:c,props:{},children:[{type:b,value:"During gameplay, the server and client interacts through web sockets. It was very important to handle all game logic on the server to prevent the user from cheating by manipulating the JavaScript variables. The 'game loop' which runs on the server at 30 frames per second, emits a ‘tick’ event to the client after each frame which sends with it the data needed to render the game world on the client’s computer screen. The client sends key down, key up and click events to the server through its web socket, the server then processes this information and returns the new model."}]},{type:a,tag:e,props:{id:B},children:[{type:b,value:C}]},{type:a,tag:c,props:{},children:[{type:b,value:"This application was built using Vue, along with Pixi.js to render the game on a WebGL context."}]},{type:a,tag:e,props:{id:D},children:[{type:b,value:E}]},{type:a,tag:c,props:{},children:[{type:b,value:"The server was built using Node, Express, TSOA, Mongoose with MongoDB and socket.io.\nThere are some API endpoints to handle user information, but most of the work\nis done with WebSockets."}]}],toc:{title:m,searchDepth:d,depth:d,links:[{id:x,depth:d,text:y},{id:z,depth:d,text:A},{id:B,depth:d,text:C},{id:D,depth:d,text:E}]}},_type:n,_id:"content:portfolio:online-multiplayer-shooter.md",_source:o,_file:"portfolio\u002Fonline-multiplayer-shooter.md",_extension:p},surrounds:[{_path:"\u002Fportfolio\u002Finteractive-map",_dir:i,_draft:f,_partial:f,_locale:j,_empty:f,title:"Interactive Map",description:"The Interactive Holiday Park Map project's objective was to make the process of booking a holiday and exploring a holiday park a more immersive and satisfying experience.",keywords:"Vuejs, Interactive Map, Holiday Park, MongoDB, Node.js",image:"\u002Fimages\u002Fproject-interactive-map-thumbnail.webp",banner:"\u002Fimages\u002Fproject-interactive-map-banner.webp",type:s,date:"4",tags:[t,q,u,v,w],body:{type:k,children:[{type:a,tag:l,props:{id:"iteractive-map"},children:[{type:b,value:"Iteractive Map"}]},{type:a,tag:c,props:{},children:[{type:b,value:"This project was my dissertation while studying Computer Science at Plymouth University and received a strong first."}]},{type:a,tag:c,props:{},children:[{type:a,tag:g,props:{href:"https:\u002F\u002Fgithub.com\u002Fmattfletcher94\u002Finteractive-map",target:h},children:[{type:b,value:"See Github Repo"}]}]},{type:a,tag:c,props:{},children:[{type:a,tag:g,props:{href:"https:\u002F\u002Fyoutu.be\u002FHku3ORswnwE",target:h},children:[{type:b,value:"See Demo Video"}]}]},{type:a,tag:e,props:{id:F},children:[{type:b,value:G}]},{type:a,tag:c,props:{},children:[{type:b,value:"The Interactive Holiday Park Map project's main objective was to make the process of\nbooking a holiday and exploring a holiday park a more immersive and satisfying\nexperience. This was accomplished by providing Holiday Park Owners\nwith the ability to annotate their Holiday Park maps. Each with its own unique\nconfiguration, the annotations mark anything from park facilities to camping\npitches. Holiday Parks that use the Pitched Booking system can integrate it into their\nInteractive Map, linking the system's units with their map annotations. Holiday\nSearchers could then view the Map, click on individual annotations to view more\ninformation, and search for availability to get a visual representation of which holiday\npitches or caravans are available on their desired arrival date. For instance, those\ninterested in fishing might want to reserve a caravan near the fishing lake."}]},{type:a,tag:e,props:{id:H},children:[{type:b,value:I}]},{type:a,tag:c,props:{},children:[{type:b,value:"The Interactive Holiday Park Map can be broken down into a collection of deliverables,\neach with its own set of tasks and priorities. These deliverables were reached\nbefore the application was published. Each project has both end-to-end and unit tests."}]},{type:a,tag:e,props:{id:J},children:[{type:b,value:K}]},{type:a,tag:c,props:{},children:[{type:b,value:"The first application, referred to as the Back Office, will be for Holiday Park owners to\ncreate and annotate their interactive maps. It will be set out like an admin dashboard\nand require the user to log in to access it. This application was built using\nVue and BootstrapVue, along with Pixi.js to render the map."}]},{type:a,tag:e,props:{id:L},children:[{type:b,value:M}]},{type:a,tag:c,props:{},children:[{type:b,value:"The second application, referred to as the Embedded Map, will present the interactive\nMap to Holiday searchers. The application can be linked directly or embedded onto\nHoliday Parks' websites and works equally well on desktop and mobile devices.\nThis application was built using Vue, along with Pixi.js to render the map."}]},{type:a,tag:e,props:{id:N},children:[{type:b,value:q}]},{type:a,tag:c,props:{},children:[{type:b,value:"The REST API, which drives both web applications and follow standard REST\nprotocol. Some routes are protected using a JWT authentication mechanism. The\nREST API provides developers with a page of auto-generated documentation.\nThe REST API was built using Node, Express, TSOA and Mongoose with a MongoDB."}]}],toc:{title:m,searchDepth:d,depth:d,links:[{id:F,depth:d,text:G},{id:H,depth:d,text:I},{id:J,depth:d,text:K},{id:L,depth:d,text:M},{id:N,depth:d,text:q}]}},_type:n,_id:"content:portfolio:interactive-map.md",_source:o,_file:"portfolio\u002Finteractive-map.md",_extension:p},{_path:"\u002Fportfolio\u002Fquantum-supremacy",_dir:i,_draft:f,_partial:f,_locale:j,_empty:f,title:O,description:"I wrote a scientific research paper based on a topic related to Computer Science. Quantum Mechanincs and Quantum Computing is a topic that interests me.",keywords:"Scientific, Research, Quantum, Computing",image:"\u002Fimages\u002Fproject-quantum.webp",type:"Scientific Research Report",date:"2",tags:["Scientific","Research","Quantum","Computers"],body:{type:k,children:[{type:a,tag:l,props:{id:"quantum-supremacy-scientific-research-report"},children:[{type:b,value:O}]},{type:a,tag:c,props:{},children:[{type:b,value:"This project required me to write a scientific research paper\non a topic related to Computer Science. I decided to write\nabout Quantum Computing since this topic interests me.\nAlthough report writing is not my favourite task,\nthis is my best-written work and received a strong First."}]},{type:a,tag:e,props:{id:P},children:[{type:b,value:Q}]},{type:a,tag:c,props:{},children:[{type:b,value:"The concept of a quantum computer evolved out of the issues raised by Richard Feynman in\n1982 in his paper entitled Computer Simulations of Physics, which ponders the question “Can\nwe simulate physics on a computer?”. He addressed several issues associated with\nconventional computer simulations of physics, most notably quantum physics and the need\nto improve methods for representing large amounts of electrons in different states. Feynman\nargued that although simulating physics on a traditional machine is theoretically possible, it is\nimpractical due to the computing cost rising exponentially as the simulation grows in size\n(Feynman, 1982). Therefore, Feynman proposed that to replicate real-world physics, we would\nneed to design a machine “of a different kind”, a quantum programmable machine that could\nimitate the laws of quantum mechanics, namely a quantum computer."}]},{type:a,tag:c,props:{},children:[{type:b,value:"The term quantum supremacy was born out of Feynman’s ideas. The Google A.I. team states\nthat the realisation of quantum supremacy is when a quantum computer provides a dramatic\nincrease in speed compared to all known classical algorithms (Arute et al., 2019). However, IBM\nstates that quantum supremacy is achieved when a quantum computer has solved a problem\nthat classical computers cannot solve (Palan et al., 2019). Thus, Google A.I. asserts that\nquantum supremacy is defined by benchmarking against conventional computers. In contrast,\nIBM asserts that it occurs when a quantum computer can perform tasks that a conventional\ncomputer cannot. IBM’s definition seems to correlate better with Feynman’s original proposal\nthat a quantum programmable machine would be required to simulate the quantum world.\nFor this paper, it is assumed that quantum supremacy is achieved when quantum computers\nprogress past intriguing scientific endeavours and begin performing tasks that classical\ncomputers are incapable of performing or are incapable of performing quickly enough for\npractical applications."}]},{type:a,tag:c,props:{},children:[{type:b,value:"This paper will begin by providing context for some of the concepts underlying quantum\ncomputing and how it operates. Following that, a debate will occur about what the team\nheaded by the Google A.I. has achieved and whether or not their claim of reaching quantum\nsupremacy with their Sycamore processor is valid since they received a large amount of\ncriticism from IBM. The paper will provide a section discussing the prospects of quantum\ncomputing, whether it will eventually replace classical computers or supplement them "},{type:a,tag:"span",props:{},children:[{type:b,value:"..."}]}]}],toc:{title:m,searchDepth:d,depth:d,links:[{id:P,depth:d,text:Q}]}},_type:n,_id:"content:portfolio:quantum-supremacy.md",_source:o,_file:"portfolio\u002Fquantum-supremacy.md",_extension:p}]}},prerenderedAt:1674981750174}}("element","text","p",2,"h2",false,"a","_blank","portfolio","en","root","h1","","markdown","content","md","REST API","Online Multiplayer Shooter","Full Stack Project","Vue.js","MongoDB","Express","WebGL","overview","Overview","web-sockets","Web Sockets","front-end","Front-end","server","Server","objectives","Objectives","project-deliverables","Project Deliverables","web-application-back-office","Web Application: Back Office","web-application-embedded-map","Web Application: Embedded Map","rest-api","Quantum Supremacy Scientific Research Report","report-snippet","Report Snippet"))